import React from 'react'
import s from './Users.module.css'
import { NavLink } from 'react-router-dom'

const Users = (props) => {
    const pageCountNum = Math.ceil(props.usersCount / props.trueUsersCount)
    let pageCount = []
    for (let i = 1; i <= pageCountNum; i++) {
        pageCount.push(i)
    }
    return (
        <div className={s.main}>
            {pageCount.map(item => <span className={props.activePage===item ? s.active : s.page} onClick={() => props.changePage(item)}>{` ${item}`}</span>)}
            {props.users.map(item => <User name={item.name} userId={item.id}/>)}
        </div>
    )
}

    const User = (props) => {
        return (
            <NavLink to={`/Profile/${props.userId}`} ><div>{props.name}</div></NavLink>
        )
    }
export default Users
